import './index.scss'

const SkillsBall = () => {
  return (
    <span>
        const TagCloud = require('TagCloud');

        const container = '.tagcloud';
        const texts = [
            '3D', 'TagCloud', 'JavaScript',
            'CSS3', 'Animation', 'Interactive',
            'Mouse', 'Rolling', 'Sphere',
            '6KB', 'v2.x',
        ];
        const options = {};

        TagCloud(container, texts, options);
    </span>
  )
}

export default SkillsBall
